import React, { Component } from "react";
import { Grid, Image } from "semantic-ui-react";
import { withTranslation } from "react-i18next";
import { imageUrl, playStoreHref, AppleHref } from "./config";
class TabletMainSection extends Component {
  render() {
    const language = localStorage.getItem("i18nextLng");
    const { t } = this.props;
    return (
      <div className={`TabletMainSection ${language}`}>
        <Grid columns={2} padded>
          <Grid.Column>
            <Image
              src={
                language === "ar"
                  ? `${imageUrl}/landing-page/TabletMainSection-AR@3x-min.png`
                  :`${imageUrl}/landing-page/Hero-EN@3x-min.png`
              }
              alt="landingPage header image"
              className="MainSectionImage"
              loading="lazy"
            />
          </Grid.Column>
          <Grid.Column>
            <div className={`tabletheaderSectionDescription ${language}`}>
              <span>{t("landingPage:landingPageHeaderTitle")}</span>
              <p>{t("landingPage:landingPageHeaderMainTitle")}</p>
              <div>
                <p> {t("landingPage:landingPageHeaderDescription")}</p>
                <p>
                {t("landingPage:landingPageHeaderDescription2")}
                </p>
         
              </div>
            </div>
            <div className={`TabletHeaderdownloadLinksTitle ${language}`}>
              {t("landingPage:tabletDownloadLinksTitle")}
            </div>
            <div className={`TabletHeaderdownloadLinks ${language}`}>
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/Google%20Play@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishApp%20Store@3x-min.png`
                }
                href={language === "ar" ? `${playStoreHref}` : `${AppleHref}`}
                target="_blank"
                alt="googlePlay"
                className="footerdownloadLinksImages"
              />
              <Image
                src={
                  language === "ar"
                    ? `${imageUrl}/landing-page/App%20Store@3x-min.png`
                    : `${imageUrl}/landing-page/EnglishGoogle%20Play@3x-min.png`
                }
                href={language === "ar" ? `${AppleHref}` : `${playStoreHref}`}
                target="_blank"
                alt="appStore"
                className="footerdownloadLinksImages"
              />
            </div>
          </Grid.Column>
        </Grid>
      </div>
    );
  }
}
export default withTranslation("landingPage")(TabletMainSection);
